import { useState, useEffect } from "react";
import axios from "axios";
import './Home.scss';

const url = "http://127.0.0.1:8000/api/list/";

const Home = () => {

    const [data, setData] = useState([]);
    
    useEffect(() => {
        const getData = async () => {
                axios({
                    method: 'GET',
                    url: url
                })
                    .then((response) => {
                        setData(response.data);
                        console.log(response);
                    })
                    .catch((error) => console.log(error));
        }
        getData();
    },[]);


    return ( 
        <div>
            Body Contain Here
            {
                    data.map((note) => ( 
                        <div key={note.id} className="names">
                            <h3 id="copy" > <span> Title  </span><span1>: </span1>"{note.title}"</h3>
                            <p id="copy" > <span> DES </span><span1>: </span1>"{note.description}"</p>
                            <p id="copy" > <span>  Pin </span><span1>: </span1>"{note.pin}"</p>
                        </div>
                        
                    ))
                }
        </div>
     );
}
 
export default Home;
